            var playAudio = function (datos) {
                var dat = datos.split("|");
                document.getElementById("audioPlaca").innerHTML = "";
                document.getElementById("audioPlaca").innerHTML = "<BR><BR><BR><BR>" + dat[1];
                if (parseInt(dat[0]) === 1 || parseInt(dat[0]) === 3)
                    document.getElementById("backPlaca").style.backgroundColor = "gold";
                if (parseInt(dat[0]) === 2)
                    document.getElementById("backPlaca").style.backgroundColor = "white";
                if (parseInt(dat[0]) === 4 || parseInt(dat[0]) === 7) {
                    document.getElementById("backPlaca").style.backgroundColor = "blue";
                    document.getElementById("backPlaca").style.color = "whitesmoke";
                }
                $('#placaModal').show();
                $('#placaModalBack').show();
                var video = document.getElementById("video");
                video.muted = true;
                playDing();
                var i = 0;
                var j = 0;
                var placa = dat[1];
                var c = placa.split("");
                //                        console.log(placa.length);
                var proceso = setInterval(function () {
                    if (i === 0) {
                        playVehiculo();
                    }
                    if (i > 1 && i <= placa.length + 1) {
                        pronunciar(c[j]);
                        j++;
                    }
                    if (i === placa.length + 2) {
                        playFinalizado();
                    }
                    if (i === placa.length + 3) {
                        playVentanilla();
                    }
                    if (i === placa.length + 5) {
                        video.muted = false;
                        $('#placaModal').hide();
                        $('#placaModalBack').hide();
                        clearInterval(proceso);
                    }
                    i++;
                }, 800);
            };

